import React, { useState } from 'react';
import { Button, TextField, Container, Typography, CssBaseline, Grid, Box, Paper } from '@mui/material';

const Signup = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSignup = () => {
    // Handle the signup logic here, e.g., make an API request to register the user
  };

  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <Paper elevation={3}>
        <div>
          <Typography component="h1" variant="h5">
            Sign Up
          </Typography>
          <form noValidate>
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <Button
              type="button"
              fullWidth
              variant="contained"
              color="primary"
              onClick={handleSignup}
            >
              Sign Up
            </Button>
          </form>
        </div>
        <Box mt={5}>
          {/* Additional content or links can go here */}
        </Box>
      </Paper>
    </Container>
  );
};

export default Signup;
